import { FaGithub, FaLinkedin, FaDocker, FaReact } from "react-icons/fa";
import {
	DiVisualstudio,
	DiGithubBadge,
	DiSass,
	DiStackoverflow,
	DiWordpress
} from "react-icons/di";

import styled from "styled-components";
function HomePage() {
	return (
		<>
			<Header>
				<h1>Sean Lyons</h1>
				<ul>
					<li>
						<FaGithub />
					</li>
					<li>
						<FaLinkedin />
					</li>
				</ul>
			</Header>
			<main>
				<section className="technologies">
					<div className="icons">
						<DiVisualstudio />
						<FaDocker />
						<FaReact />
						<DiGithubBadge />
						<DiSass />
						<DiStackoverflow />
						<DiWordpress />
					</div>
				</section>
				<section className="skillsexperience">
					<p>on the way</p>
				</section>
			</main>
			<footer></footer>
			<style jsx global>{`
				@import url("https://fonts.googleapis.com/css?family=Abril+Fatface&display=swap");

				html,
				body {
					margin: 0;
					padding: 0;
				}
				header {
				}
				h1 {
					font-family: "Abril Fatface", sans-serif;
				}
			`}</style>
		</>
	);
}
const Header = styled.header`
	background: #61ce70;
	padding: 50px 0;
	color: #fff;
	text-shadow: 2px 2px 4px rgba(0, 0, 0, 0.5);
`;

export default HomePage;
